import React from 'react';
import MarsMissionActions from '../components/MarsMissionActions';


function MarsMissionsPage() {
    return (
        <div className="container">
            <h1>Mars Missions</h1>

            <MarsMissionActions />
        </div>
    );
}

export default MarsMissionsPage;
